const startDate = new Date("2025-08-01");

// Hoy
const now = new Date();

// Primer día del mes actual (máximo para el since)
const maxSince = new Date(now.getFullYear(), now.getMonth(), 1);

// Fecha final permitida para "until"
const finalUntil = new Date("2025-12-31");

const dayInMs = 1000 * 60 * 60 * 24;
const range = 15;
const output = [];

for (let date = new Date(startDate); date <= now; date = new Date(date.getTime() + range * dayInMs)) {
	const from = new Date(date);
	let to = new Date(date.getTime() + (range - 1) * dayInMs);

	// Ajuste para no pasar de hoy
	if (to > now) {
		to = new Date(now);
	}

	// Ajuste para no pasar del finalUntil (opcional si quieres mantenerlo)
	if (to > finalUntil) {
		to = new Date(finalUntil);
	}

	output.push({
		json: {
			since: from.toISOString().split("T")[0],
			until: to.toISOString().split("T")[0],
		}
	});
}

return output;
